import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the first product's "Add to Cart" button
    await page.waitForSelector('.product-card .add-to-cart:not([disabled])', { timeout: 5000 });
    await page.click('.product-card .add-to-cart:not([disabled])');

    // Wait for cart count to update
    await page.waitForFunction(() => {
      const cartCount = document.querySelector('.cart-count');
      return cartCount && cartCount.textContent !== '0';
    }, { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_to_cart.png'));

    // Extract product details
    const productTitle = await page.$eval('.product-card .product-title', el => el.textContent.trim());
    const productPrice = await page.$eval('.product-card .product-price', el => {
      const priceText = el.textContent;
      return priceText.match(/\$\d+\.\d{2}/)?.[0] || priceText;
    });

    return {
      success: true,
      action: "Added first product to cart successfully",
      extractedData: {
        productTitle,
        productPrice,
        cartCount: await page.$eval('.cart-count', el => el.textContent)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add first product to cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
